import C from '../assets/icons8-c-programming-96.png';
import Cpp from '../assets/icons8-c++-96.png';
import Python from '../assets/icons8-python-144.png';
import HTML from '../assets/icons8-html-5-144.png';
import CSS from '../assets/icons8-css3-144.png';
import PSQL from '../assets/icons8-postgresql-144.png';





function Skills() {
    return (
        <div className='skills'>
            {/* container */}
                <div>
                    <section id="content" className="text-gray-600 body-font">
                        <div className="container px-5 py-24 mx-auto">
                            <div className="flex flex-wrap w-full mb-20">
                                <div className="lg:w-1/2 w-full mb-6 lg:mb-0">
                                    <h1 className="sm:text-3xl text-2xl font-medium title-font mb-2 text-gray-900">About My All Projects</h1>
                                    <div className="h-1 w-20 bg-blue-500 rounded"></div>
                                </div>
                                <p>Skills Which i Learned</p>
                                </div>
                            </div>
                            </section> 
                            <div>
                                <div>
                                    <img className='w-20 mx-auto' src={C} alt="C icon"></img>
                                    <p>C</p>
                                </div>
                            </div>
                        </div>
                </div>
                );
};

                export default Skills;
